        if(yPos >= 218){
            doc.addPage();
            doc.addImage(background_fix,'png', 0, 0,210,297);
            yPos = 45;
        }

        yPos += 7;

        doc.text("Pemohon", 135, yPos);
        doc.addImage(data,'png', 135, yPos,25,25);
        yPos += 22;
        doc.line(135, yPos, 165, yPos);
        yPos += 7;
        doc.text(name, 135, yPos);

        // console.log(yPos);

