        // }

        doc.addPage();
        yPos = 45;
        doc.addImage(background_fix,'png', 0, 0,210,297);

        doc.setFontSize(16);
        doc.text("Pernyataan Pemenuhan Form Kerja GA", 20, yPos);
        yPos += 10;
        // doc.line(20, yPos, 150, yPos);
