        doc.setFontSize(11);
        var splittext = doc.splitTextToSize("Dengan ini pemohon menyatakan bahwa pengajuan perintah kerja telah diselesaikan oleh Tim General Affair sesuai dengan deskripsi yang diajukan,  ", 170);
