        yPos += 5;
        doc.text("Tanggal :", 23, yPos);
        doc.text("Tanggal :", 79.6, yPos);
        doc.text("Tanggal :", 136.4, yPos);
        yPos += 3;
        doc.line(20, yPos, 190, yPos);




        // doc.setProperties({ title: 'FPK - '+dateTime });
        doc.setProperties({ title: id_spk});
        var formData = new FormData();
        formData.append('id_fpk' , data_fpk['id']);
        formData.append('nama_file' , id_spk);
        formData.append('file_fpk' , doc.output('blob'));
