    function simpan_to_trello(){
        var idList = '62a95b6de5aa40089754ff41';
        var key = '6a708346ca5432fc510200f0b0f555c1';
        var token = 'cd02196880c9446c6664de3374d091646ddfc5b87c5804430d149fd99dc84e2d';
        var name = $('#no_surat').val()+' || '+$('#jenis_perintah').val() + ' || ' + $('#divisi').val()+ ' || ' + $('#name').val() ;
        var desc = $('#deskripsi').val();
        var pos = 'top';
        var due = $('#deadline').val();

        $.ajax({
            type: "POST",
            url: "https://api.trello.com/1/cards",
            data: {
                'key' : key,
                'token' : token,
                'idList' : idList,
                'name' : name,
                'desc' : desc,
                'pos' : 'top',
                'due' : due,
                'idMembers' : ["60175ea8388c5e6fc7100826","6142d06e5e19df2eacb83054","5e941c09355d666a873123f6","63a9642464b5cd016c418c67"],
            },
            success: function(response) {
                console.log(response);
                console.log('Sukses');
                var form_data = new FormData();
                var total_file = document.getElementById('file_spk').files.length;
                id_spk = response.id;

                if(total_file>=1){
                    form_data.append('key' , key);
                    form_data.append('token' , token);
                    form_data.append('file' , '');
                    // Input Attachment to Trello
                    for(var i = 0; i<total_file; i++){
                        form_data.set('file',document.getElementById('file_spk').files[i]);
                        $.ajax({
                            url: "https://api.trello.com/1/cards/"+response.id+"/attachments",
                            type: 'post',
                            data: form_data,
                            contentType: false,
                            processData: false,
                            success: function(response) {
                                console.log(response);
                            },
                            error: function(error) {
                                console.log('gagal');
                                console.log(error);
                            }
                        });
                    }
                }
            },
            error: function(error) {
                console.log('gagal');
                console.log(error);
            }
        });
    }

